Proteus 2利用新技术，我们一直在开发，将各种区域和地区添加到世界中。

我们已经增加了世界纹理的数量增加了数百万的草叶，并且填充了无数的新外国人叶子 - 每个人都会产生各种资源​​。
;

您现在可以发现您在冒险中观察的一切。远远超过一个简单的成就，发现系统实际上解锁了任何找到的资源都会产生的所有资源。

基本上，资源上使用的每个武器或工具可以产生不同的项目，允许对太阳系和所有生命形式的远远探索。
;

现在可以在更新的GPS上过滤矿物质。这款非常方便的工具，现在可以随时可用，不再连接到您的定位器，从周围的卫星读取和您自己的内部套装雷达以创建检测到半径。

该系统将向您展示所有周围的矿物质，其硬度和密度，因此您可以在制作任务中找到您正在寻找的内容。
