1-1。物理环境在生存中起着至关重要的作用。温度，天气系统，地形和土着生活形式都对健康和可持续性有直接影响。意识到这些要素和它们具有最重要的效果。

1-2。预防措施，早期识别和快速治疗有助于最大限度地减少功能下降的可能性和可能的​​死亡。简而言之，意识是关键。
;

1-5。额外的太阳能行星的地形可以有奇妙的，必须小心翼翼地遍历。任何误操作都可能导致损坏您的EVA套装并导致适合突发，这可能是灾难性的。极端谨慎探索它是不可原谅的。

1-6。坡。在尝试爬坡时，请务必查看斜坡警告指示。对于大于30度的斜坡，无论是倾斜还是下降，都会为您的遍历构成危险。不建议试图跳跃或运行这种不均匀的地形。

如果需要，蹲伏可以用来横穿极限斜坡。;

3-1。生活质量在很大程度上取决于营养，水合和一般健康。随着时间的推移，身体状况会恶化，影响速度和生存。饥饿和渴望，如果没有纠正，会导致健康和表现下降。热和冷等气候条件也有效果。必须使用提供的套装读数来监测这些。

3-2。当物理条件降低和健康受损时，使用某些类型的食物和绷带可以进行愈合。为了维持生命，愈合至关重要。
;

7-5。 U.N.E.操作员可能会发现自己与其他人员联系。在这些情况下，这些人员可以通过建立派对或殖民地进行分组。

7-6。设置派对：对于创建派对的人员，他们需要走到另一个手术，看看它们，然后按[F]邀请。然后，加入一方的人员必须查看和Inver，然后单击菜单中的[接受]。
